import * as React from 'react';
import Button from '@mui/material/Button';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import logoImg from '../img/basket_logo.png'
import './Header.css';
import { Outlet, Link } from 'react-router-dom';

function Header() {
    return (
        <>
            <div className="Header">
                <Box sx={{ flexGrow: 1 }}>
                    <AppBar sx={{ bgcolor: "#343a40" }} position="fixed">
                        <Toolbar >
                            <Link to='/'>
                                <Box display={"flex"} alignItems={"center"} gap={0.5} sx={{ textDecoration: 'none' }}>
                                    <img width="54px" height="54px" src={logoImg} alt="logo" />
                                    <Typography variant='h4' sx={{ color: '#E36414', width: 'fit-content' }}> BasketiX </Typography>
                                </Box>
                            </Link>
                            <Box sx={{ marginLeft: 'auto' }} >
                                <Link to='/resultats'> <Button variant="text">Resultat</Button> </Link>
                                <Link to='/actu'> <Button variant="contained">Actu</Button> </Link>
                                <Link to='/autre'> <Button variant="outlined">Autre</Button> </Link>
                            </Box>

                        </Toolbar>
                    </AppBar>
                </Box>
            </div >
            <Outlet></Outlet>
        </>
    );
}

export default Header;
